import React from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";

const Navbar = () => {
  return <nav>
    <h2>X eats</h2>
      <Link to="/">
        Home
      </Link>
      <Link to="/signin">
        Signin
      </Link>
      <Link to="/search">
        Search
      </Link>
  </nav>;
};

export default Navbar;
